function addValue(value) {
    var input = document.getElementById("input")
    console.log(input)
    input.value += value
}
function calc() {
    var input = document.getElementById("input")
    console.log(input.value)
    var ans = eval(input.value)
    console.log("ans", ans)
    input.value = ans
}

function clearInput() {
    document.getElementById('input').value = " "
}
function delOne() {
    var input = document.getElementById("input")
    input.value = input.value.slice(0, -1)
}


